description:
When I picked this one up, I had hoped it would contain more. Apparently, this was an hour-long CBS special in 2001; showing a retrospective of the show. It includes two new subpar musical numbers, but it still has enough of the good stuff to be worth a look. There are better collections out there, so I will look for those and upload them. Still, if you have never seen Carol, you should check this out. A fun way to spend a little time.
